import {React} from "react"
import bookielogo from '../assets/bookielogo.png'
import './Menu.css'
import {Link} from 'react-router-dom';

function Menu(){

    return(
    <div className="header">
        <img src={bookielogo} alt="log" class="logo"/>
        <ul class="header_List">
            <li><Link to="/Vasarlas">V치s치rl치s</Link></li>
            <li>Elad치s</li>
            <li>Chat</li>
            <li>Profilom</li>
        </ul>
    </div>
    )
}

export default Menu;
